import React from 'react';

function Favoritos({ favoritos }) {
  return (
    <div className="favoritos">
      <h2>Atletas Favoritos</h2>
      <ul>
        {favoritos.map((atleta, index) => (
          <li key={index}>{atleta.nome}</li>
        ))}
      </ul>
    </div>
  );
}

export default Favoritos;
